To use our command allocated buffers we must bind various resources and specify parameters of operations, this can be thought of as recording these into our command buffers. Each command buffer must be recorded individually, in our case we only have 1 so it somewhat simplifies the process. Commands are recorded into the command buffer between vkBeginCommandBuffer() and vkEndCommandBuffer(), it cannot be submitted before we finish recording by calling vkEndCommandBuffer(). // Allocated command buffer options
VkCommandBufferBeginInfo beginInfo = { .sType = VK_STRUCTURE_TYPE_COMMAND_BUFFER_BEGIN_INFO, // Buffer only submitted once .flags = VK_COMMAND_BUFFER_USAGE_ONE_TIME_SUBMIT_BIT
};
// Start recording commands
VK_CHECK_RESULT(vkBeginCommandBuffer(*commandBuffer, &beginInfo)); // Binds pipeline (our functions)
vkCmdBindPipeline(*commandBuffer, VK_PIPELINE_BIND_POINT_COMPUTE, pipeline);
// Binds descriptor set (our data)
vkCmdBindDescriptorSets( *commandBuffer, VK_PIPELINE_BIND_POINT_COMPUTE, pipelineLayout, 0, 1, &descriptorSet, 0, nullptr
); Set number of workgroups. If we need 1050 x invocations and our workgroup x size is 1024 (layout(local_size_x = 1024, local_size_y = 1, local_size_z = 1) in;) we need to dispatch with at least 2 workgroup. Thus with dims being the number of invocations we need [x,y,z] and dimLengths being our workgroup size [x,y,z] we set the number of workgroups we need as such: // Sets invocations
vkCmdDispatch( *commandBuffer, ceil(dims[0] / static_cast<float>(dimLengths[0])), ceil(dims[1] / static_cast<float>(dimLengths[1])), ceil(dims[2] / static_cast<float>(dimLengths[2]))
); When we finish recording, our buffer is in an executable state and can be submitted. Recording commands do not report errors, if they occur, they are reported by the vkEndCommandBuffer(). To finish recording we call vkEndCommandBuffer(). // End recording commands
VK_CHECK_RESULT(vkEndCommandBuffer(*commandBuffer));

